export declare const getISSUE = "\n  query GetISSUE($id: ID!) {\n    getISSUE(id: $id) {\n      id\n      name\n      desc\n      __typename\n    }\n  }\n";
export declare const listISSUES = "\n  query ListISSUES(\n    $filter: TableISSUEFilterInput\n    $limit: Int\n    $nextToken: String\n  ) {\n    listISSUES(filter: $filter, limit: $limit, nextToken: $nextToken) {\n      items {\n        id\n        name\n        desc\n        __typename\n      }\n      nextToken\n      __typename\n    }\n  }\n";
